window.bookSummaryJSON = "<p>Luke Tavares has dreamed of joining the vast gaming guilds of the hypernet. After recently graduating high school, his parents have given him the same ultimatum as his siblings; he has one month to get a job to pay for his air, gravity, and water aboard the <i>Dahlia</i>.</p> <p>The freighter needs more hands, but Luke doesn’t want to be a trader-ship engineer. In Sphere World, he can mine asteroids, build bots, and make weapons to fuel the system-wide war between nodes.</p> <p>As a free player, it is his own credits on the line. But when his opponents are the very guilds that he wishes to join, he’s going to have to use every trick he knows to win.</p>"; 
